import React from 'react'

const  FormField = ({formdata,}) => {

      const renderTemplate = () => {
        let formTemplate = null;

        switch(formdata.element){
          case('input'):
              formTemplate = (
                <div>
                  INPUT SOMETHING
                </div>
              )
          break;
          default:
              formTemplate = null;

        }
        return formTemplate
      }
  return (
    <div>
        {renderTemplate}
    </div>
  )
}

export default FormField;
